import React from 'react';
import { BrowserRouter, Routes, Route, NavLink } from 'react-router-dom';
import Index from '../Components/Index';
import About from '../Components/About';
import Section from '../Components/Services';
import Pricing from '../Components/Pricing';
import Stats from '../Components/Stats';
import Contact from '../Components/Contact';
import Portfolio from '../Components/Portfolio';
import AddToCart from '../Components/AddToCart';
import Signup from '../Components/Signup';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/dashboard" element={<Index />} />
        <Route path="/about" element={<About />} />
        <Route path="/section" element={<Section />} />
        <Route path="/portfolio" element={<Portfolio />} /> 
        <Route path="/signup" element={<Signup />} />
        <Route path="/stats" element={<Stats />} />
        <Route path="/pricing" element={<Pricing />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/addToCart" element={<AddToCart />} />
      </Routes>
      <Header /> {/* Header component rendered outside of Routes */}
    </BrowserRouter>
  );
}

function Header() {
  const isSignupPage = window.location.pathname === '/signup';

  return (
    <header>
      <nav>
        <ul>
          <li>
            <NavLink to="/dashboard" disabled={isSignupPage}>Dashboard</NavLink>
          </li>
          <li>
            <NavLink to="/about" disabled={isSignupPage}>About</NavLink>
          </li>
          <li>
            <NavLink to="/section" disabled={isSignupPage}>Services</NavLink>
          </li>
          <li>
            <NavLink to="/portfolio" disabled={isSignupPage}>Portfolio</NavLink>
          </li>
          <li>
            <NavLink to="/signup">Signup</NavLink>
          </li>
          <li>
            <NavLink to="/stats" disabled={isSignupPage}>Stats</NavLink>
          </li>
          <li>
            <NavLink to="/pricing" disabled={isSignupPage}>Pricing</NavLink>
          </li>
          <li>
            <NavLink to="/contact" disabled={isSignupPage}>Contact</NavLink>
          </li>
          <li>
            <NavLink to="/addToCart" disabled={isSignupPage}>Add to Cart</NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default App;
